import { TestBed, tick } from '@angular/core/testing';

import { ImageServiceService } from './image-service.service';


describe('ImageServiceService', () => {
  const service = new ImageServiceService();
  beforeEach(() => TestBed.configureTestingModule({}));

  it('should be created', () => {
    expect(service).toBeTruthy();
  });
  describe('GetBase64WithJPG', () => {
    it('should encode a string', async () => {
      const res = await service.getBase64(
        // tslint:disable-next-line: max-line-length
        new File(['iVBORw0KGgoAAAANSUhEUgAAAA0AAAAQCAYAAADNo/U5AAAABHNCSVQICAgIfAhkiAAAABl0RVh0U29mdHdhcmUAZ25vbWUtc2NyZWVuc2hvdO8Dvz4AAAAaSURBVCiRY7x169J/BhIBE6kaRjWNahoZmgDYhQOlAISk2wAAAABJRU5ErkJggg=='],
        'test.png'),
        false
      );
      // tslint:disable-next-line: max-line-length
      const want = 'data:application/octet-stream;base64,aVZCT1J3MEtHZ29BQUFBTlNVaEVVZ0FBQUEwQUFBQVFDQVlBQUFETm8vVTVBQUFBQkhOQ1NWUUlDQWdJZkFoa2lBQUFBQmwwUlZoMFUyOW1kSGRoY21VQVoyNXZiV1V0YzJOeVpXVnVjMmh2ZE84RHZ6NEFBQUFhU1VSQlZDaVJZN3gxNjlKL0JoSUJFNmthUmpXTmFob1ptZ0RZaFFPbEFJU2syd0FBQUFCSlJVNUVya0pnZ2c9PQ==';
      expect(res).toEqual(want);
    });

    it('rejects with error', async () => {
      const want = new Error('The input file should not be null.');
      let have: Error;
      try {
        await service.getBase64(null, false);
      } catch ( e ) {
        have = e;
      }
      expect(have).toEqual(want);
    });

    it('encodes an image', async () => {
      const file = await fetch('https://i.imgur.com/gNue8Za.jpg')
      .then(r => r.blob()) // Gets the response and returns it as a file
      .then(blob => new File([blob], 'test.jpg'));

      const res = await service.getBase64( file, false );

      // tslint:disable-next-line: max-line-length
      const want = 'data:application/octet-stream;base64,';
      // console.log('EXPECT: ' + want.substring(0, 44) + ', ' + res.substring(0, 44));
      expect(want).toEqual(res);
    });
    it('resizes an image', async () => {
      // tick(1000);
      const file = await fetch('https://i.imgur.com/gNue8Za.jpg')
      .then(r => r.blob()) // Gets the response and returns it as a file
      .then(blob => new File([blob], 'test.jpg', { type: 'jpg'}));

      const res = await service.getBase64( file, true );
      console.log(res);
      console.log(file.size + ', ' + res.length);
      expect(file.size > res.length).toEqual(true);
    });
  });
});
